import React from 'react'
export const File=({ input, type, meta: { touched, error, warning } }) => {
    delete input.value
    return (
        <div>
        <input className={hasError?"error":""} type={type} name={input.name} {...input}   multiple />
        {hasError?<span>{error}</span>:null} 
        </div>
    )
}
